def binning(data: String) = {

    var str = data.replaceAll("[^\\d.]", "");
    var bin = ((Math.floor(str.toDouble))/100).toInt
    val mod = str.toDouble%100
    if(mod == 0 && bin!=0) bin = bin -1
    if (bin > 12) bin = 12
    bin
}

var finalAllData : RDD[((String, String, Int), Double)] = uc.sparkContext.emptyRDD
for (i <- 0 to finalfilesArray.length-1){
    var path = pathPrefix + finalfilesArray(i)
    println("path="+ path)
    var raw = uc.load(path)
    var rawDataset = raw.toDataset()

    var tuple = rawDataset.map{ case(x) =>
        val line = x.toString.split(" ")
        val arquivo = finalfilesArray(i).substring(0,14)
        val data = line(0).drop(1).replace('.', '-')
        val bin = binning(line(6))
        var amp = 0.0
        if(line.size >= 8)
            amp = line(8).dropRight(1).replaceAll("[^\\d.]", "").toDouble
        (arquivo, data, line(2), bin, amp)
    }

    var preProcessedInfo = tuple.map{case (arquivo, data,hora,bin,amp) => ((arquivo, data,bin), (amp, 1))}
        .reduceByKey((x, y) => (x._1 + y._1, x._2 + y._2))
        .map{case(a,b) => (a, b._1/b._2)}

    finalAllData = finalAllData.union(preProcessedInfo)
}
